import React from "react";

export default function Home() {
  return (
    <div>
      <h1>응애 우리 글쓸거야</h1>
      <h3>왜냐면 우린 멋지니까</h3>
      <h6>
        <p>이런식으로 요리조리 웹사이트도 리액트로 만들어 놓고, 이것저것 공부한거, 생각한거 쓰고 하면 나중에 도움이 되겠지?<br /> 그래서 만드는거지롱</p>
      </h6>
    </div>
  );
}
